import { Platform } from "react-native";
import { ECharts } from "react-native-echarts-wrapper";
import theme from "../styles/theme";

const LineGraph = ({ x, y }) =>
    <ECharts
        option={{
            a: console.log(Platform.OS),
            xAxis: {data: x},
            yAxis: {},
            series: [{
                data: y,
                type: "line"
            }]
        }}
        backgroundColor={theme.primary2}
    />

export {
    LineGraph
}
